import React from 'react';
import styled from 'styled-components';

const App = () => {
  const Button = styled.button`
    .btn {
      background-color: green;
      color: #fff;
      font-size: 16px;
      text-align: center;
      padding: 6px 30px;
    }
  `;

  return (
    <>
      <Button className="btn">Subcribe Shyam</Button>
    </>
  );
};

export default App;
